    public static function getRandom($array,$rate){
        $rate = explode(':',$rate);
        $sum = 0;
        $left = 0;
        $right = 0;
        foreach($rate as $value){
            $sum+=$value*10;
        }
        $temp = rand(0,$sum);
        foreach($rate as $key=>$value){
            $right+=$value*10;
            if($left<=$temp && $temp<$right){
                return $array[$key];
            }
            $left+=$value*10;
