    public static function wepay(){

        Lib_make::WePayInit(self::$mode);
        $url = Lib_make::oauthUrl(self::$mode);
        return redirect($url);
    }

    public static function oauth(Request $request){

        $code = $request->get('code');
        $error = $request->get('error');

        Lib_make::WePayInit(self::$mode);

        if(!empty($error)){
            return false;
        }
        if(empty($code)){

            $url = Lib_make::oauthUrl(self::$mode);
            return redirect($url);
        }else{
            $info = Lib_make::getToken(self::$mode,$code);

            if ($info) {
                // YOUR ACCESS TOKEN IS HERE

                $access_token = $info->access_token;
                Cache::put('1_token',$info->access_token,86000);
                //获取 pay iframe 账号

                $we_info = Lib_make::WeInfo($access_token);
                if(empty($we_info)){
                    return view('loading.create_user',['access_token'=>$access_token]);
                }else{
                    return view('loading.choose',['we_info'=>$we_info,'access_token'=>$access_token]);
                }
            } else {
                dd($info);
            }

        }
    }

